import React from "react";
import styled from "styled-components";

const SloganHeaderBlock = styled.div`
  display: block;
  padding-top: 10px;
  padding-left: 30px;
  padding-right: 10px;
  p {
    display: inline-block;
    font-size: 1.5rem;
    font-weight: bold;
    color: white;
  }
  background: #1c1c1c;
  &
  }
`;

const Menubar = styled.div`
  display: inline-block;
  font-size: 1rem;
`;

function Slogan_Header() {
  return (
    <SloganHeaderBlock>
      <p>EndLess Creation</p>
      <menubar />
    </SloganHeaderBlock>
  );
}

export default Slogan_Header;
